{"changed":true,"filter":false,"title":"models.py","tooltip":"/tickets/models.py","value":"from django.db import models\nfrom django.utils import timezone\n\n\n# Create your models here.\nclass Ticket(models.Model):\n    \n    title = models.CharField(max_length=254, default='')\n    summary = models.TextField(blank=False)\n    ticket_type = models.CharField(max_length=30)\n    upvotes = models.IntegerField(default=0)\n    total_paid = models.DecimalField(max_digits=10, decimal_places=2, default=0)\n    creator = models.CharField(max_length=150) \n    status = models.CharField(max_length=30, default='Backlog')\n    initiation_date = models.DateTimeField( default=timezone.now)\n    completion_date = models.DateTimeField(blank=True, null=True)\n    \n    def __str__(self):\n        return \"{0} - {1}\".format(self.ticket_type, self.title)","undoManager":{"mark":-1,"position":-1,"stack":[]},"ace":{"folds":[],"scrolltop":0,"scrollleft":0,"selection":{"start":{"row":9,"column":49},"end":{"row":9,"column":49},"isBackwards":false},"options":{"guessTabSize":true,"useWrapMode":false,"wrapToView":true},"firstLineState":0},"timestamp":1573674755109}